import React from 'react';
import { Link } from 'react-router-dom'; 
import './Home.css';

function Home() {
  return (
    <div className="App">
      <header className="App-header">
        <header>
            <div class="logo-wrapper">
                <a class="logo">MAKASTORY</a>
                <a class="subtitle">Generating stories for kids</a>
            </div>
            <ul>

                <Link to="/voice">
                <a className="large-button">Voice</a>
                </Link>
                <Link to="/text">
                  <a className="large-button">Text</a>
                </Link>
                <a className="large-button">Makaton</a>

            </ul>
        </header>
      </header>
    </div>
  );
}

export default Home;
